window.bookSummaryJSON = "<p>Despite the spoils of a solid relationship and an idyllic life at Keystone, Raven is itching for the thrill of another big case. Things begin to heat up when a dangerous assignment falls in her lap. </p> <p>Searching for the mastermind behind an illegal fighting ring is no easy feat, but as the weeks roll by, Raven's undercover job begins to take an unexpected emotional toll. It's a deadly mission, and if she's not careful, she could lose everything. </p> <p>The stakes are high in this powerful new installment of the <i>USA Today</i> best-selling Crossbreed series.</p>"; 
